    n, k = map(int, stdin.split())
    s = list(stdin.strip().lower())
    s.sort()

    def backtrack(curr_cost: int, curr_set: set, target_size: int, start: int):
        if len(curr_set) == target_size:
            return curr_cost
        if len(curr_set) > target_size:
            return -1

        if start == n:
            return -1

        for i in range(start, n):
            if i > start and s[start] == s[i]:
                continue

            new_set = curr_set.copy()
            new_set.add(s[i])
            new_cost = curr_cost + (n - i - 1)
            if new_cost < 0:
                continue

            cost = backtrack(new_cost, new_set, target_size, i + 1)
            if cost!= -1:
                return cost

        return -1

    return str(backtrack(0, set(), k, 0))

