    def replace_zeros(s: str) -> str:
        count_0 = count_ones(s)
        count_1 = count_zeros(s)
        count_2 = n - count_0 - count_1
        return s.replace('0', '1' * count_1).replace('1', '2' * count_2)

    def balanced_ternary(s: str) -> str:
        count_0 = count_ones(s)
        count_1 = count_zeros(s)
        count_2 = n - count_0 - count_1
        return '0' * count_0 + '1' * count_1 + '2' * count_2

    def lexicographically_smallest(s1: str, s2: str) -> str:
        return ''.join(sorted(s1 + s2))

    def replace_min(s: str) -> str:
        min_count = min(count_zeros(s), count_ones(s))
        return ''.join([s[i] for i in range(n) if s[i] == '0'] * min_count + ['1'] * count_zeros(s) + ['2'] * count_ones(s))

    def replace_max(s: str) -> str:
        max_count = max(count_zeros(s), count_ones(s))
        return ''.join([s[i] for i in range(n) if s[i] == '0'] * count_zeros(s) + ['1'] * min_count + ['2'] * max_count)

    def replace_min_balanced(s: str) -> str:
        min_count = min(count_zeros(s), count_ones(s))
        return ''.join(['0'] * count_zeros(s) + ['1'] * min_count + ['2'] * count_ones(s))

    def replace_max_balanced(s: str) -> str:
