        count = 0
        for i in range(1, int(n ** 0.5) + 1):
            if n % i == 0:
                count += 1
                if i!= n // i:
                    count += 1
        return count

    def is_prime(n: int) -> bool:
        if n < 2:
            return False
        for i in range(2, int(n ** 0.5) + 1):
            if n % i == 0:
                return False
        return True

    positive_divisors = []
    for i in range(2, N + 1):
        if is_prime(i) and factorial(i) % MOD == 0:
            positive_divisors.append(i)

