    if not valid_indices:
        return '0 0'

    def optimal_solution(valid_indices, valid_estimations, min_time):
        def min_time_helper(problem_indices, problem_estimations, current_time, remaining_time):
            if current_time == min_time and remaining_time == 0:
                return 0, []
            if current_time > min_time:
                return float('inf'), []

            problem_index = problem_indices[0]
            problem_estimate = problem_estimations[problem_index]
            if remaining_time < problem_estimate:
                return float('inf'), []

            remaining_problems = problem_indices[1:]
            remaining_estimations = problem_estimations[1:]
            for i, remaining_problem_estimate in enumerate(remaining_estimations):
                next_min_time = current_time + remaining_problem_estimate
                new_time, new_indices = min_time_helper(remaining_problems, remaining_estimations, next_min_time, remaining_time - remaining_problem_estimate)
                if new_time!= float('inf'):
                    return new_time + problem_estimate, problem_index + [i] + new_indices

        return min_time_helper(valid_indices, valid_estimations, 0, 300)

    total_time = sum(valid_estimations)
    num_accepted = 0
    min_penalty_time = float('inf')

    for i, problem_estimate in enumerate(valid_estimations):
        if problem_estimate == 0:
            continue

        time_left, accepted_indices = optimal_solution(valid_indices[:i] + valid_indices[i+1:], valid_estimations[:i] + valid_estimations[i+1:], 30 + problem_estimate)
