    def gcd(a: int, b: int) -> int:
        while b:
            a, b = b, a % b
        return a

    def lcm(a: int, b: int) -> int:
        return a * b // gcd(a, b)

    def solve(m: int, n: int, t: List[int], x: List[int]) -> List[int]:
        t = sorted(t)
        x = sorted(x)
        d = [0] * n

