            if k == len(t):
                continue
            while t[k] < i * 3600:
                k += 1
                if k == len(t):
                    break
            lcm_speed = d[k - 1] // gcd(x[k - 1], x[k])
            ans.append(lcm_speed)

        return ans

    def bisect_left(arr: List[int], x: int) -> int:
        lo, hi = 0, len(arr)
        while lo < hi:
            mid = (lo + hi) // 2
            if arr[mid] < x:
                lo = mid + 1
            else:
                hi = mid
        return lo

