                if len(root) < min_len and is_anagram(word, root):
                    min_len = len(root)
                    shortest = root
        return shortest

    def solve(word: str) -> str:
        if is_multigram(word):
            return shortest_root(word)
        else:
            return -1

    return str(solve(word))

