    def dijkstra(graph, start, end):
        dist = {node: float('inf') for node in graph}
        dist[start] = 0

        while dist[end] == float('inf'):
            next_dist = {node: float('inf') for node in graph}
            for node in graph:
                for neighbor, weight in graph[node].items():
                    if dist[node] + weight < next_dist[neighbor]:
                        next_dist[neighbor] = dist[node] + weight
            dist = next_dist

        return dist[end]

    def reconstruct_roads(graph, n):
        road_count = dijkstra(graph, 1, n)
        roads = []

        for i in range(n - 1):
            for j in range(i + 1, n):
