        sin_angle, cos_angle = math.sin(angle), math.cos(angle)
        rotated_points = [(x * cos_angle - y * sin_angle, x * sin_angle + y * cos_angle) for x, y in points]
        return rotated_points

    def rescale_points(points: list, ratio: float) -> list:
        rescaled_points = [(x * ratio, y * ratio) for x, y in points]
        return rescaled_points

    def rearrange_points(points: list, angle: float, ratio: float) -> list:
        rotated_points = rotate_points(points, angle)
        rescaled_points = rescale_points(rotated_points, ratio)
