def solution(stdin: str) -> str:
    N = int(stdin.split()[0])
    board = [list(row) for row in stdin.split()[1:]]

    def is_valid(r: int, c: int) -> bool:
        return 1 <= r <= N and 1 <= c <= N

    def is_blocked(r: int, c: int) -> bool:
        return board[r - 1][c - 1] == "#"

    def is_knight(r: int, c: int) -> bool:
        return board[r - 1][c - 1] == "K"

    def get_valid_moves(r: int, c: int) -> list:
        moves = [(r + 2, c + 1), (r + 2, c - 1), (r - 2, c + 1), (r - 2, c - 1), (r + 1, c + 2), (r + 1, c - 2), (r - 1, c + 2), (r - 1, c - 2)]
        return [move for move in moves if is_valid(move[0], move[1]) and not is_blocked(move[0], move[1])]

    def bfs(r: int, c: int, visited: set) -> int:
        queue = [(r, c)]
        visited.add((r, c))
        steps = 0

        while queue:
            steps += 1
            size = len(queue)

            for _ in range(size):
                x, y = queue.pop(0)
                moves = get_valid_moves(x, y)

                for move in moves:
                    if move not in visited:
                        visited.add(move)
                        queue.append(move)

        return steps if is_knight(r, c) else -1

    def min_steps(r: int, c: int) -> int:
        visited = set()
        return bfs(r, c, visited)

    r, c = 1, 1
    result = min_steps(r, c)
    if result == -1:
        print(-1)
    else:
