def solution(stdin: str) -> str:
    key_phrase, plaintext = stdin.split('\n')

    # Create the encryption key table
    key = ''
    for i in range(5):
        key += key_phrase[i]

    # Create the encrypted text
    encrypted_text = ''
    for i in range(len(plaintext)):
        plaintext_char = plaintext[i]
        if plaintext_char == 'x':
            encrypted_text += 'x'
            continue

        plaintext_char = plaintext_char.upper()
        row, col = i // 5, i % 5
        if plaintext_char == key[row]:
            # Rule 1: X after first letter
            if i > 0 and plaintext[i - 1] == key[row]:
                encrypted_text += 'X'
                continue

            # Rule 2: Replace with letters to right
            if col == 0:
                encrypted_text += key[row]
                encrypted_text += key[(row + 1) % 5]
            elif col == 4:
                encrypted_text += key[row]
                encrypted_text += key[(row - 1) % 5]
            else:
                encrypted_text += key[row]
                encrypted_text += key[(row + 1) % 5]
                encrypted_text += key[(row - 1) % 5]
        elif plaintext_char == key[col]:
            # Rule 3: Replace with letters below
            if row == 0:
                encrypted_text += key[col]
                encrypted_text += key[(col + 5) % 5]
            elif row == 4:
                encrypted_text += key[col]
                encrypted_text += key[(col - 1) % 5]
            else:
                encrypted_text += key[col]
                encrypted_text += key[(col + 5) % 5]
                encrypted_text += key[(col - 1) % 5]
        else:
            # Rule 4: Replace with letters on same row
            encrypted_text += key[row]
            encrypted_text += key[(row + 1) % 5]
            encrypted_text += key[(row - 1) % 5]

    return encrypted_text.upper()

